import React from 'react';
import './history.scss';


const History = (props) => {
  const route = sessionStorage.getItem('route');
  const url = sessionStorage.getItem('url');
  return (
    <div>
      <h3>History</h3>
      <section className="history">
        <ul>
          {route.map((item, i) => {
            return (
              <li key={i}>{item}</li>
            );
            })}
        </ul>
        <p>testing</p>
      </section>
    </div>
  )
}

export default History;
